CowboyRule_winning_hands_desc:
Les joueurs peuvent miser sur l’une des cinq catégories de mains gagnantes;
a) Carte haute, une paire;
b) Deux paires;
c) Triples, main couleur, quinte;
d) Main pleine;
e) Quads, quinte-couleur, quinte royale. La récompense du joueur est basée sur les chances de chaque bonne mise.

